import "./style.css"
import { Button } from "../button"
import NuKenzieBlack from "../assets/NuKenzieBlack.png"


export const Header = ({ children, button }) => {
    return (
        <header>
            <nav>
                {children}
                {button}
            </nav>
        </header>
    )
}
